import React from "react";
import "./Footer.css";
import { AiOutlineCopyrightCircle } from "react-icons/ai";
const Footer = () => {
  return (
    <footer>
      <h1>
        <span>
          <AiOutlineCopyrightCircle />
        </span>
        <span> Robosoft Technologies 1996-2022</span>
      </h1>
    </footer>
  );
};

export default Footer;
